(67,'Si bien se puede configurar asignar un chofer tanto por distancia del origen, como por el que menos haya facturado... Se precisa que se pueda asignar por AMBAS a la vez. Es decir que se pueda asignar el viaje al que este más cerca del destino y también al que menos haya facturado. \n\nPor ejemplo, si dos 10 choferes están cerca del origen del viaje ¿A quién se lo doy? Al que menos haya facturado. Por eso se precisa que se pueda asignar por ambas modalidades en conjunto.',-1,36,478,'valentina@apreciasoft.com','valentina@apreciasoft.com','MEJORA - Eliminación de bases - Asignación de Choferes - URGENTE','Solicitud Finalizada!\nSaludos!',0,'2017-10-30 22:32:53','2017-10-31 20:00:13',NULL,'TK-000066',0,NULL),
(68,'LAS NOTIFICACIONES DE LA APP CHOFER SOLAMENTE FUNCIONAN SI EL CHOFER ESTA DENTRO DE LA APLICACION, SI EL CHOFER DEJA ABIERTA LA APP EN SEGUNDO PLANO NO RECIBE NINGUN POP UP, ALERTA NI SONIDO DE LA MISMA.\nLA UNICA NOTIFICACION QUE RECIBE ES VIA MAIL.',-1,32,347,'gr@remisesnext.com','gr@remisesnext.com','MEJORA APP CHOFER (URGENTE)','Hola,\nSu solicitud a sido finalizada!\nGracias por aguardar!',0,'2017-10-30 22:56:30','2017-10-31 20:12:48',NULL,'TK-000063',1,NULL),
(69,'LA NOTIFICACION RECIBIDA POR EL CHOFER VIA MAIL ESTA INCOMPLETA YA QUE FALTAN LOS SIGUIENTES DATOS:\n\n-TELEFONO PASAJERO\n-HORA DE ARRIBO\n-VUELO/BUQUE\n-PROCEDENCIA\n-EMPRESA AEROLINEA\n-AEROPUERTO\n-TERMINAL\n\nTAMBIEN HAY QUE CAMBIAR EL ASUNTO DEL MAIL (FWD: DETALLES DE RESERVAS ASREMIS A:  \"FWD: DETALLES DE RESERVAS REMISES NEXT\") COMO ASI TAMBIEN EL PRIMER RENGLON DEL CUERPO DEL CORREO (DETALLES DE RESERVAS ASREMIS A:  \"DETALLES DE RESERVAS REMISES NEXT\")',-1,32,347,'gr@remisesnext.com','gr@remisesnext.com','MEJORA APP CHOFER (IMPORTANTE)','Solicitud Finalizada!\nSaludos!',0,'2017-10-30 23:18:55','2017-10-31 19:59:14',NULL,'TK-000068',1,NULL),
(70,'EN EL CAMPO INFORMACION ADICIONAL DE VIAJE EMPRESA FALTA CAMPO PARA AGREGAR INFORMACION PARA EL CHOFER.\nACTUALMENTE HAY UN CAMPO DE OBSERVACIÓN COMPARTIDA PARA EL OPERADOR Y PARA EL CHOFER.\nNECESITAMOS TENER UNO APARTE PARA EL CHOFER YA QUE AMBOS PERFILES DE USUARIOS NO TIENEN EL MISMO MANEJO DE INFORMACIÓN/OBSERVACIONES DE LOS SERVICIOS.',-1,32,347,'gr@remisesnext.com','gr@remisesnext.com','MEJORA DASHBOARD (IMPORTANTE)','Estimados. Justamente el separar las observaciones parte de que los distintos perfiles manejan distintas informaciones. Por eso hemos creado dos campos de observaciones para el viaje empresa:\n\n1) De operador a chofer.\n2) De operador a operador. \n\nBásicamente esta como lo solicitan, esta el campo para el Chofer y otro para el Operador.\nSaludos cordiales.',0,'2017-10-30 23:24:30','2017-10-31 19:55:36',NULL,'TK-000069',1,NULL),
(71,'DESDE LA APP CLIENTE, AL SOLICITAR UNA RESERVA, NO HAY CAMPO PARA QUE EL CLIENTE PUEDA AGREGAR NINGUNA OBSERVACION COMO POR EJEMPLO:\n\n-PISO\n-DEPARTAMENTO\n-LOTE/UNIDAD FUNCIONAL\n-ENTRE CALLES\n-PROPIETARIOS\n-CANTIDAD DE PASAJEROS\n-CANTIDAD DE EQUIPAJE\n- NUMERO DE VUELO/PROCEDENCIA/AEROLINEA\n-OBSERVACIONES VARIAS PARA LA CORRECTA REALIZACION DEL SERVICIO',-1,32,347,'gr@remisesnext.com','gr@remisesnext.com','MEJORA APP CLIENTE (IMPORTANTE)','Solicitud Finalizada!\nSaludos!',0,'2017-10-30 23:30:04','2017-10-31 19:56:17',NULL,'TK-000070',0,NULL),
(72,'NECESITAMOS QUE LOS OPERADORES SEAN CAPACES DE PODER REASIGNAR UN SERVICIO QUE SE ENCUENTRE EN CUALQUIER ESTADO, SIN QUE SEA NECESARIO TENER QUE CANCELAR EL MISMO Y TENER QUE CREARLO NUEVAMENTE PARA PODER REASIGNARLO.\n\nESTA FACULTAD UNICAMENTE ESTA HABILITADA PARA LOS VIAJES EN ESTADO: ESPERA DE ACEPTACION YA QUE UNA VEZ PASADO ESTE ESTADO SIEMPRE SE DEPENDE QUE EL CHOFER CANCELE EL SERVICIO UNILATERALMENTE PARA PODER REASIGNARLO.\n\nLA RAZON PARA ESTA SOLICITUD ES PODER SER CAPACES DE REEMPLAZAR CUALQUIER CHOFER POR OTRO, EN EL CASO QUE DURANTE CUALQUIERA DE LAS ETAPAS DE UN SERVICIO ALGUN CHOFER TENGA UN PERCANCE O NO SE LO PUEDA CONTACTAR O EL FACTOR QUE DETERMINE EL OPERADOR Y QUE NO LE PERMITA: COMENZAR, CONTINUAR O FINALIZAR UNO O VARIOS SERVICIOS QUE LE HUBIESEN SIDO ASIGNADOS. ',-1,32,347,'gr@remisesnext.com','gr@remisesnext.com','MEJORA DASHBOARD (URGENTE)','Hola,\nEste servicio ya se encuentra disponible!\nDeben activar la funcion desde, CONFIGURACION / Config. General.',0,'2017-10-30 23:41:42','2017-10-31 19:59:44',NULL,'TK-000071',0,NULL),
