(11,56,528,NULL,'Estimados. En la Grilla de Viajes, sólo se muestra el Origen y el Destino del viaje. En este caso al ser un viaje multi destino, se va a reflejar el último destino asignado. Los demás destinos de dicho viaje, se muestran a través del semáforo ¿Cómo? Se enciende en color rojo el icono compuesto por la MD y si selecciono este icono, me abre una ventana al centro de la pantalla donde puedo visualizar enumeradamente los destinos agregados. Saludos cordiales.','2017-11-23 02:33:17',32),
